  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
  year. The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, and raptors- is also covered. The Refuge development and maintenance
  section discusses physical developments. Resource management is outlined; topics
  include grazing and commercial fishing. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge participation, hunting, trapping, violations,
  and safety.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
